		assertEquals("printCheckerBoard(\"AAA\", 3, 2);", "***AAA\nAAA***\n***AAA", retrieveSystemOutput());
	}

	@TestCase(expectedOutput="****JAVA****JAVA****JAVA")
	public void test1() throws Exception {
	    MethodHolder.printCheckerBoard("JAVA", 1, 6);
		assertEquals("printCheckerBoard(\"JAVA\", 1, 6);", "****JAVA****JAVA****JAVA", retrieveSystemOutput());
	}

	@TestCase(
	            expectedOutput="*****@@@@@*****@@@@@*****\n"+
                                "@@@@@*****@@@@@*****@@@@@\n"+
                                "*****@@@@@*****@@@@@*****\n"+
                                "@@@@@*****@@@@@*****@@@@@\n"+
                                "*****@@@@@*****@@@@@*****"
            )
	public void test2() throws Exception {
	    MethodHolder.printCheckerBoard("@@@@@", 5, 5);
	    String answer = "*****@@@@@*****@@@@@*****\n"+
                        "@@@@@*****@@@@@*****@@@@@\n"+
                        "*****@@@@@*****@@@@@*****\n"+
                        "@@@@@*****@@@@@*****@@@@@\n"+
                        "*****@@@@@*****@@@@@*****";
		assertEquals("printCheckerBoard(\"@@@@@\", 5, 5);", answer, retrieveSystemOutput());

	}


	@TestCase(expectedOutput="", hidden=true)
	public void test3() throws Exception {
	    MethodHolder.printCheckerBoard("BBB", 3, 2);
		assertEquals(printCheckerBoard("BBB", 3, 2), retrieveSystemOutput());

	}

	@TestCase(expectedOutput="", hidden=true)
	public void test4() throws Exception {
	    MethodHolder.printCheckerBoard("X", 10, 10);
		assertEquals(printCheckerBoard("X", 10, 10), retrieveSystemOutput());

	}


	@TestCase(expectedOutput="", hidden=true)
	public void test5() throws Exception {
	    MethodHolder.printCheckerBoard("XYZ", 10, 10);
		assertEquals(printCheckerBoard("XYZ", 10, 10), retrieveSystemOutput());

	}


	@TestCase(expectedOutput="", hidden=true)
	public void test6() throws Exception {
	    MethodHolder.printCheckerBoard("XYZ", 1, 10);
		assertEquals(printCheckerBoard("XYZ", 1, 10), retrieveSystemOutput());

	}
	private static String printCheckerBoard(String input, int row, int col){
        StringBuilder sb = new StringBuilder();
        for(int i = 0; i < row; i++){
            for(int j = 0; j < col; j++){
                if((i+j) % 2 == 0){
                    sb.append(printStars(input));
                } else{
                    sb.append(input);
                }
            }
            if(i != row - 1){
                sb.append("\n");
            }
        }
        return sb.toString();
    }

    private static String printStars(String input){
        StringBuilder sb = new StringBuilder();
        for(int i = 0; i < input.length(); i++){
            sb.append("*");
        }
        return sb.toString();
    }
}

